import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Game from "./pages/Game";

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Wrapper>
          <Route exact path="/discover" component={Game} />
        </Wrapper>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
